(1, 'Joshua Ogallo', 'team', '2021-07-1511:08:31imageMD(joshuaogallo)-min.JPG', 'omulloa@edition.coma', NULL, NULL, NULL, NULL, NULL, 'Managing Director', NULL, 'James is a partnership development professional. He has vast experience working in both the Nongovernmental sector, Private sector and startup environment. He holds a Master\'s degree in Public Policy and Management from Strathmore Business School and Bachelor of Business Administration (Accounting) degree from the University of Eastern Africa Baraton. He enjoys deep sea fishing, reading and traveling. Cars are his greatest interest.', '$2y$10$LmF9JtCv2.4uxNTbQd5oEuDr/YZyfpRG2PJxIrPGbe8kzzloxxA9C', NULL, '2020-06-28 12:31:46', '2020-06-28 12:31:46'),
(2, 'Lilian Njue', 'team', '2021-09-3000:40:49imageAccountant(lilianmurugi)(1).jpg', 'info@editioninvestments.com', NULL, 'https://twitter.com', NULL, NULL, NULL, 'Accountant', NULL, 'Numbers and details are a natural passion for Florence and her day is most successful when she has analyzed business trends based on the numbers of the day. She holds a CPA-K and is currently pursuing her masters in Finance and Accounting. If not enjoying an afternoon with her friends, she’d be reading or watching her kind of epic, gothic or drama movies or series.', '$2y$10$RAnzS8Pzm029qFIxFkDzY.dtjCBqvN337lL8.PSiKtwQ7mtQfA2Ke', 'sBto0yIoDiSrudOe7UfTMhakLjLBxMzSIAqZG9Nt2qckjHJ2GJUqkhxbpyA1', NULL, '2019-06-10 10:12:27'),
(3, 'Clifton Ruto', 'team', '2021-07-1511:05:32imagesalesexecutive(cliftonruto)-min.JPG', 'obalo@ediioninvestments.com', NULL, NULL, NULL, NULL, NULL, 'Sales Executive', NULL, 'A well-seasoned relationship manager with vast experience in managing projects and ensuring all stages are well planned to ascertain availability and flow of supplies. Eunice is the go to person for an uplifting read. She also loves to travel and enjoys outdoor activities.', '$2y$10$QGboNw.wACt6Wgn.Lc1yC.OUmg3q0Y/QAPzP/ipH8YS60fbRRVpz2', NULL, '2020-06-28 12:29:25', '2020-06-28 12:29:25'),
(4, 'Audicuah Nderi', 'team', '2021-07-1511:11:37imageproductionsupervisor(audicuahnderi)-min.JPG', 'wambugu@domain.com', NULL, NULL, NULL, NULL, NULL, 'Production Supervisor', NULL, 'Hezborn has been severally described as a bowl of energy and has an undying love for properly done wooden and wood based interiors. He holds a Masters in Wood Technology from Schule fur Holz und Gestaltung, Germany and a Civil Engineering diploma from KIHBT. He has a vast experience in wood processing, mdf and particle boards and has a working knowledge of various design softwares including Archicard, Veray and Enscape. An adventure', '$2y$10$iqwRaKhvSynYfQHf75IwUenKfXdL/LThnjHtAnCtCjizC6IuVfeHe', NULL, '2020-06-28 12:30:22', '2020-06-28 12:30:22'),
(5, 'Josephine Oluleka', 'team', '2021-07-1511:06:53imageadministrator(josephineoluleka)-min.JPG', 'omullo@edition.com', NULL, NULL, NULL, NULL, NULL, 'Administrator', NULL, 'Audiciah is a result oriented professional with articulate organizational skills. She is a creative that thrives in an environment where the abstract can be brought to life and is well versed with various computer aided design software and holds a diploma in Information Technology. When not attending to our clients, you will likely find Audiciah enjoying a movie at the cinemas or chilled out at a nice restaurant over brunch.', '$2y$10$LmF9JtCv2.4uxNTbQd5oEuDr/YZyfpRG2PJxIrPGbe8kzzloxxA9C', NULL, '2020-06-28 12:31:46', '2020-06-28 12:31:46'),
(6, 'Brian Oanga', 'team', '2021-07-1511:12:13imageQS(BrianOanga)-min.JPG', 'omullo@edition.coma', NULL, NULL, NULL, NULL, NULL, 'Asst. Quantity Surveyor', NULL, NULL, '$2y$10$LmF9JtCv2.4uxNTbQd5oEuDr/YZyfpRG2PJxIrPGbe8kzzloxxA9C', NULL, '2020-06-28 12:31:46', '2020-06-28 12:31:46');
