(685, 'GainaTet', 'Главный американский эксперт по вирусам профессор Энтони Фаучи разбранил Белый дом за проведение мероприятия, связанного с пандемией Covid-19. \r\nПрофессор Фаучи, член главного отдела Белого дома по коронавирусу, высказал, что обнародование кандидатуры президента Дональда Трампа в Верховный суд было \"сверхпредсказуемым событием\". \r\nВо всяком случае, одинадцать человек, посетивших мероприятие 26 сентября, дали положительный тест. \r\nДональд Трамп идет на поправку от коронавируса. \r\nЕго врачи только сейчас разрешили ему проводить общественные собрания, менее чем за месяц до того, как он встретится с кандидатом от демократической партии Джо Байденом на выборах президента. \r\nМр. Трамп негативно относится к таким мерам, как маски и блокировка, для борьбы с распространением Covid-19, в результате которого погибло более 213000 человек в США. Он говорил о перспективах создания лекарства, хотя исследователи утверждают, что это скорее всего не произойдет раньше грядущего года. \r\nОпрос показывает, что г-н Байден опережает Трампа на одну цифру, а голосование ABC News / Ipsos показал, что лишь 35% американцев одобряют то, как Трамп справился с кризисом. \r\nСледующие президентские дебаты через несколько дней между Трампом и его кандидатом от демократов в Белом доме Джо Байденом отклонены. \r\nВыборная комиссия заявила в заявлении в пятницу, что обе кампании объявили «альтернативные планы на эту дату». \r\nГ-н Трамп отклонил по просьбе комиссии прокурировать вскрытие 15 октября практически, чтобы минимизировать риск распространения коронавируса. \r\nКомиссия заявила, что все еще готовится к третьим и заключительным президентским дебатам в Нэшвилле, в штате Теннесси, 22 октября. \r\nВ кампании Трампа говорилось, что комиссия была не честной по отношению к Байдену, а штат Демократической партии обвинил президента в том, что он отказался провести дебаты с ними. Данные с сайта <a href=https://rctorg.top/jwh-250.html>rctorg.top</a>', 0, 'benjamindmitchellf@gmail.com', '85348642486', NULL, 'В Белом доме состоялось мероприятие COVID-19 \'superspreader\', озвучил профессор Фаучи', '2021-10-18 16:25:20', '2021-10-18 16:25:20'),
