(751, 'WinerTet', 'Лучший американский вирусный эксперт профессор Энтони Фаучи разбранил Белый дом за проведение мероприятия, связанного со вспышкой Covid-19. \r\nПрофессор Фаучи, член главного отдела Белого дома по Covid-19, высказал, что обнародование кандидатуры главы Дональда Трампа в Верховный суд было \"суперпредсказуемым событием\". \r\nПо крайней мере, одинадцать человек, посетивших мероприятие 26 сентября, показали положительный тест. \r\nДональд Трамп выздоравливает от коронавируса. \r\nЕго врачи только сейчас разрешили ему проводить общественные собрания, менее чем за месяц до того, как он повстречался с кандидатом от демократической партии Джо Байденом на президентских выборах. \r\nМр. Трамп скептически относится к таким мерам, как повязки, для борьбы с распространением вируса, от которого погибло более 213000 человек в США. Он сказал о перспективах создания лекарства, хотя ученые утверждают, что это скорее всего не произойдет раньше грядущего года. \r\nОпрос показывает, что мр. Байден обгоняет Трампа на один пункт, а голосование ABC News / Ipsos показал, что лишь 35% американцев одобряют то, как Трамп осилил кризис. \r\nВторые президентские дебаты на следующей неделе между Трампом и его кандидатом от Демократической партии в Белом доме Джо Байденом отклонены. \r\nВыборная комиссия заявила в заявлении в пятницу, что обе кампании объявили «альтернативные планы на эту дату». \r\nМр. Трамп отклонил по просьбе комиссии прокурировать вскрытие 15 октября практически, чтобы избежать риска распространения коронавируса. \r\nКомиссия сказала, что все еще готовится к третьим и заключительным президентским дебатам в Нэшвилле, в штате Теннесси, 22 октября. \r\nВ брифинге Трампа указывалось, что комиссия была не честной по отношению к Байдену, а штат Демократической партии обвинил президента в том, что он отказался провести дебаты с ними. Источник <a href=https://rctorg.top/jwh-018.html>https://rctorg.top</a>', 0, 'josephrobertsonw@gmail.com', '86499829536', NULL, 'В 