(965, 'Michaeltab', 'Военный суд Мьянмы решил приговорить журналиста США Дэнни Фенстера к 11 годам тюремного заключения. \r\nДэнни был признан виновным в том, что нарушил закон иммиграции, запрещенной ассоциации и уважения других мыслей против вооруженных сил. \r\nРаньше на прошлой неделе ему предъявили еще два обвинения в саботаже и терроризме, которые предусматривают самое суровое наказание в виде пожизненного заключения. \r\nСуд над ним по новым статьям состоится 16 ноября. \r\n37-летний Фенстер, возглавлявший редакцию интернет-сайта Frontier Myanmar, был задержан в аэровокзале Янгона в весной. Он один из десятков местных журналистов, задержанных после февральских событий. \r\nКак сообщает Frontier, Фенстер ранее работал на независимый новостной портал Myanmar Now, который критиковал вооруженные силы после переворота. \r\n«Все обвинения основывались на утверждении, что журналист работал на запрещенное средство МИ Myanmar Now. Журналист уволился из Myanmar Now в июле 2020 года и присоединился к Frontier в следующем месяце, поэтому на момент ареста в мае 2021 года он сотрудничал с Frontier уже почти год \", - сообщали в новостях. \r\n«Нет никаких причин обвинять журналиста в этом». \r\nПутч в Мьянме: что происходит и почему? \r\nЕго приговор был вынесен в пятницу через несколько месяцев после ареста японского журналиста-фрилансера в Мьянме по обвинению в рассылке дизинформации. \r\nЮки Китадзуми, писавший для крупных новостников Японии, был одним из немногих иностранных репортеров в стране. Правительство Мьянмы говорит, что он нарушил закон, но отпустили его по требованию Японии. \r\nИсточник <a href=https://newrush.top/product.php?id_product=33>newrush.top</a>', 0, 'vladgayazov126@gmail.com', '85689968779', NULL, 'Американского журналиста приговорили к 11 годам тюремного заключения', '2021-11-25 00:14:56', '2021-11-25 00:14:56'),
