(2307, 'FrankEvarl', 'Великобритания ввела санкции против Кабаевой, бывшей жены и родственников Путина \r\nОчередные ограничения затронут бывшую жену президента России Владимира Путина Людмилу Очеретную, двух двоюродных братьев — Игоря и Романа Путиных, и других родственников и «друзей президента». \r\nКоммерсантъ \r\nМинистр иностранных дел Великобритании Лиз Трасс объявила о новых антироссийских санкциях. \r\nКоммерсантъ \r\nВ документах, опубликованных в пятницу британским правительством, отмечается, что помимо бывшей первой леди России под санкции попали, в частности Роман Путин, Игорь Путин и Михаил Путин. \r\nИнтерфакс \r\nВсего с начала специальной военной операции РФ на Украине Великобритания ввела рестрикции против более чем 1,6 тыс. российских политиков, бизнесменов, чиновников, журналистов и предприятий. \r\nТАСС \r\n \r\nrutorbestyszzvgnbky4t3s5i5h5xp7kj3wrrgmgmfkgvnuk7tnen2yd onion \r\n \r\n<a href=https://rutordarknet.com>rutor.biz</a>', 0, 'olya.glotkowa@yangoogl.cc', '85643415136', NULL, 'rutorclubkmxu6sjcvmfvz5w7oi23uf4kp63qjttfvine6ahona7bvyd onion', '2022-05-25 05:26:36', '2022-05-25 05:26:36'),
(2308, 'FrancisFut', 'Жители Белгородской области простились с погибшим при обстреле села со стороны Украины \r\nЖители Белгородской области простились в пятницу с 18-летним молодым человеком, погибшим при обстреле села Солохи со стороны Украины, сообщил губернатор региона Вячеслав Гладков. \r\nТАСС \r\nГлава региона выразил соболезнования семье, которую навестил лично. \r\nТАСС \r\nГлава региона подчеркнул, что вместе с семьёй погибшего парня «скорбит всё село, весь район и вся Белгородская область». \r\nМОЁ! Оnline Воронеж \r\nВ результате обстрела повреждены 17 домов, автомобили, школа, почтовое отделение и магазин. \r\nТАСС \r\nrutorbestyszzvgnbky4t3s5i5h5xp7kj3wrrgmgmfkgvnuk7tnen2yd onion \r\n \r\n<a href=https://rutorsite.com>рутор форум</a>', 0, 'witalinaavlashkina@yangoogl.cc', '82514164691', NULL, 'rutor biz', '2022-05-25 05:26:40', '2022-05-25 05:26:40');
